import React, { Component } from 'react'
import { style_mapping } from "../../styled";

import mainLogo from '../../../assets/logo/logo.png';

const {
    navigation: { MenuList }
} = style_mapping;

class Authmenu extends Component {
  render() {
    return (
      <MenuList>
      <li>Home</li>
      <li>Messages</li>
      <li>Search</li>
      </MenuList>
    )
  }
}

export default Authmenu
